--
-- Table structure for table `user_details`
--

CREATE TABLE `user_details` (
  `id` int(11) NOT NULL,
  `user_id` bigint(20) DEFAULT NULL,
  `job_title` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `address1` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `state` varchar(255) DEFAULT NULL,
  `country` varchar(50) DEFAULT NULL,
  `zipcode` varchar(30) DEFAULT NULL,
  `mailing_address` varchar(255) DEFAULT NULL,
  `mailing_address1` varchar(255) DEFAULT NULL,
  `mailing_city` varchar(150) DEFAULT NULL,
  `mailing_state` int(3) DEFAULT NULL,
  `mailing_country` int(4) DEFAULT NULL,
  `mailing_zipcode` varchar(50) DEFAULT NULL,
  `emergency_contact_person` varchar(255) DEFAULT NULL,
  `emergency_contact_mobile` varchar(100) DEFAULT NULL,
  `emergency_contact_phone` varchar(100) DEFAULT NULL,
  `relationship` int(3) DEFAULT NULL,
  `relationship_other` varchar(150) DEFAULT NULL,
  `offer_organisations` int(2) DEFAULT NULL,
  `offers_third_party` int(2) DEFAULT NULL,
  `country_of_birth` varchar(150) DEFAULT NULL,
  `gender` int(3) DEFAULT NULL,
  `australian_citizen` int(3) DEFAULT NULL,
  `user_image_original` varchar(255) DEFAULT NULL,
  `identity_proof` varchar(255) DEFAULT NULL,
  `identity_proof_upload_date` date DEFAULT NULL,
  `rnum` int(4) DEFAULT NULL,
  `medical_certificate` varchar(255) DEFAULT NULL,
  `medical_certificate_status` int(3) DEFAULT NULL COMMENT '0= not done yet, 1= pending, 2= need to re submit ,3=Senior Citizen need to submit each time they update medical information 5 = approved',
  `medical_certificate_upload_date` date DEFAULT NULL,
  `wwcc_id_number` varchar(255) DEFAULT NULL,
  `wwcc_expiry_date` date DEFAULT NULL,
  `wwcc_licence_upload` varchar(255) DEFAULT NULL,
  `user_image_old` varchar(255) DEFAULT NULL,
  `user_image_approve` int(3) DEFAULT NULL COMMENT '1=approved,2=waiting',
  `identity_proof_approve` int(3) DEFAULT NULL COMMENT '1=Approved by admin',
  `kart_number` varchar(255) DEFAULT NULL,
  `transponder_number` varchar(255) DEFAULT NULL,
  `kart_type` varchar(255) DEFAULT NULL,
  `sponsers` varchar(255) DEFAULT NULL,
  `parent_user_id` bigint(30) DEFAULT NULL COMMENT 'This will contain parent id if user is unlink with parent for manage the history',
  `promoter` int(3) DEFAULT NULL COMMENT '1=Yes',
  `status_verified` int(11) DEFAULT NULL,
  `reset_token` varchar(50) DEFAULT NULL,
  `activation_token` varchar(50) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `user_image_change_date` datetime DEFAULT NULL,
  `dismiss_notice` int(2) DEFAULT NULL,
  `password_changed` int(1) DEFAULT NULL,
  `authcode` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

